import './App.css';

export default class App extends Component {
  state = {
    vernagirmek: '',
  };

  Den = () => {
    this.setState(() => {
      return { vernagirmek: <i class='fas fa-map-marker-alt'></i> };
    });
  };
  Ben = () => {
    this.setState(() => {
      return { vernagirmek: 'hajox' };
    });
  };
  render() {
    return (
      <div className='App'>
        <Header Den={this.Den} Ben={this.Ben} st={this.state.vernagirmek} />
        <h1>{this.state.vernagirmek}</h1>
      </div>
    );
  }
}
